import logo from './logo.svg';
import './App.css';
import Signin from './components/Signin';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HomePage from './Views/HomePage';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route element={<HomePage />} path='/'/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
